para solicitar acesso ao CRM Voiza, indicamos a seguinte sequência de passos:
- O beneficiado deve entrar no portal gestão de identidades (https://portalgestaodeidentidade.br.wal-mart.com/idm/walmart/);
- Clicar em Meu menu -> Acessos -> Solicitar Acesso;
- Clicar na aba Perfis;
- Clicar no botão Adicionar Perfil;
- Procurar um perfil referente ao sistema Voiza;
- Selecionar o perfil desejado.
Nesse momento, a solicitação será enviada ao gestor, aguardando sua aprovação.

column3:
Preciso de ajuda para levantar os números de chamados no período de Janeiro até Abril de 2017. A extração deve ser apenas para essas tabulações:
Contabilidade -> Fechamento Contábil -> Provisão de Despesa -> Estorno de Provisão Realizada - NE/SE/SUL;
Contabilidade -> Fechamento Contábil -> Provisão de Despesa -> Prov de Despesa-NF recebida fora de competência - NE/SE/SUL;
Contabilidade -> Operações -> Reclassificações -> Reclassificações - NE/SE/SUL.
As informações que eu necessito são as seguintes:
Prot/Man Pai;
Prot/Man;
Solicitante;
1 Nivel;
2 Nivel;
3 Nivel;
4 Nivel;
Regional;
Dir. Operações;
Distrital;
Nr. Loja;
Loja;
Data de Cadastro;
Data de Encerramento;
Nível;
Responsável;
Status;
Severidade;
